type s = [
  |`Send_Recovery
  |`Send_Startviewchange
  |`Deliver_Doviewchange
  |`Send_Recoveryresponse
  |`Send_Startview
  |`Send_Commit
  |`Deliver_Prepare
  |`Deliver_Recoveryresponse
  |`Deliver_Primaryrecoveryresponse
  |`Deliver_Prepareok
  |`Deliver_Commit
  |`Send_Reply
  |`Send_Prepare
  |`Deliver_Recovery
  |`Send_Prepareok
  |`Deliver_Startviewchange
  |`Send_Doviewchange
  |`Deliver_Startview
  |`Deliver_Request
]

type t = {
  vr: Vr.states;
}

let pagefn (oc:out_channel) = ()
let set_cfn _ _ = ()
let init ~q:q = {
  vr = Vr.init ~q:q;
}


let tick s x =
  let r = match x with
  |`Send_Recovery -> 
    {s with
    vr = (Vr.tick `Send_Recovery s.vr);
    }
  |`Send_Startviewchange -> 
    {s with
    vr = (Vr.tick `Send_Startviewchange s.vr);
    }
  |`Deliver_Doviewchange -> 
    {s with
    vr = (Vr.tick `Deliver_Doviewchange s.vr);
    }
  |`Send_Recoveryresponse -> 
    {s with
    vr = (Vr.tick `Send_Recoveryresponse s.vr);
    }
  |`Send_Startview -> 
    {s with
    vr = (Vr.tick `Send_Startview s.vr);
    }
  |`Send_Commit -> 
    {s with
    vr = (Vr.tick `Send_Commit s.vr);
    }
  |`Deliver_Prepare -> 
    {s with
    vr = (Vr.tick `Deliver_Prepare s.vr);
    }
  |`Deliver_Recoveryresponse -> 
    {s with
    vr = (Vr.tick `Deliver_Recoveryresponse s.vr);
    }
  |`Deliver_Primaryrecoveryresponse -> 
    {s with
    vr = (Vr.tick `Deliver_Primaryrecoveryresponse s.vr);
    }
  |`Deliver_Prepareok -> 
    {s with
    vr = (Vr.tick `Deliver_Prepareok s.vr);
    }
  |`Deliver_Commit -> 
    {s with
    vr = (Vr.tick `Deliver_Commit s.vr);
    }
  |`Send_Reply -> 
    {s with
    vr = (Vr.tick `Send_Reply s.vr);
    }
  |`Send_Prepare -> 
    {s with
    vr = (Vr.tick `Send_Prepare s.vr);
    }
  |`Deliver_Recovery -> 
    {s with
    vr = (Vr.tick `Deliver_Recovery s.vr);
    }
  |`Send_Prepareok -> 
    {s with
    vr = (Vr.tick `Send_Prepareok s.vr);
    }
  |`Deliver_Startviewchange -> 
    {s with
    vr = (Vr.tick `Deliver_Startviewchange s.vr);
    }
  |`Send_Doviewchange -> 
    {s with
    vr = (Vr.tick `Send_Doviewchange s.vr);
    }
  |`Deliver_Startview -> 
    {s with
    vr = (Vr.tick `Deliver_Startview s.vr);
    }
  |`Deliver_Request -> 
    {s with
    vr = (Vr.tick `Deliver_Request s.vr);
    }
  |_ -> s in r
